import React, { Component } from 'react'
import './App.css';
import Navbars from './Componets/Navbars';
import NewsShow from './Componets/NewsShow';
import {
  BrowserRouter as Router,
  Switch,
  Route,

} from "react-router-dom";
export class App extends Component {
  render() {
    return (
      <div>
      <Router>
      <Navbars/>
      <NewsShow path="/" pageSize={6} country='in' category='general'/>
      <Switch>
          <Route path="/home"> <NewsShow pageSize={6} country='in' category='general'/> </Route>
          <Route path="/business"> <NewsShow pageSize={6} country='in' category='business'/> </Route>
          <Route path="/entertainment"> <NewsShow pageSize={6} country='in' category='entertainment'/> </Route>
          <Route path="/general"> <NewsShow pageSize={6} country='in' category='general'/> </Route>
          <Route path="/health"> <NewsShow pageSize={6} country='in' category='health'/> </Route>
          <Route path="/sports"> <NewsShow pageSize={6} country='in' category='sports'/> </Route>
          <Route path="/technology"> <NewsShow pageSize={6} country='in' category='technology'/> </Route>
          <Route path="/science"> <NewsShow pageSize={6} country='in' category='science'/> </Route>

      </Switch>
      </Router>

      </div>
    )
    }
}

export default App
